0435\u0444\u0444\u0440\u0438 \u0423\u044d\u0439\u0437<\/a>. 10 \u0447\u0435\u043b\u043e\u0432\u0435\u043a \u043f\u043e\u0433\u0438\u0431\u043b\u043e (\u0432\u043a\u043b\u044e\u0447\u0430\u044f \u043d\u0430\u043f\u0430\u0434\u0430\u0432\u0448\u0435\u0433\u043e), 5 \u0440\u0430\u043d\u0435\u043d\u043e. \u041d\u0430\u043f\u0430\u0434\u0430\u0432\u0448\u0438\u0439 \u0437\u0430\u0441\u0442\u0440\u0435\u043b\u0438\u043b\u0441\u044f. \u0422\u0440\u0430\u0433\u0435\u0434\u0438\u044f \u0441\u0442\u0430\u043b\u0430 \u0432\u0442\u043e\u0440\u043e\u0439 \u043f\u043e \u0447\u0438\u0441\u043b\u0443 \u0436\u0435\u0440\u0442\u0432 \u0448\u043a\u043e\u043b\u044c\u043d\u043e\u0439 \u0442\u0440\u0430\u0433\u0435\u0434\u0438\u0435\u0439 \u0432 \u0421\u0428\u0410 \u043f\u043e\u0441\u043b\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%81%D1%81%D0%BE%D0%B2%D0%BE%D0%B5_%D1%83%D0%B1%D0%B8%D0%B9%D1%81%D1%82%D0%B2%D0%BE_%D0%B2_%D1%88%D0%BA%D0%BE%D0%BB%D0%B5_%C2%AB%D0%9A%D0%BE%D0%BB%D1%83%D0%BC%D0%B1%D0%B0%D0%B9%D0%BD%C2%BB\" title=\"\u041c\u0430\u0441\u0441\u043e\u0432\u043e\u0435 \u0443\u0431\u0438\u0439\u0441\u0442\u0432\u043e \u0432 \u0448\u043a\u043e\u043b\u0435 \u00ab\u041a\u043e\u043b\u0443\u043c\u0431\u0430\u0439\u043d\u00bb\">\u043c\u0430\u0441\u0441\u043e\u0432\u043e\u0433\u043e \u0443\u0431\u0438\u0439\u0441\u0442\u0432\u0430 \u0432 \u0448\u043a\u043e\u043b\u0435 \u00ab\u041a\u043e\u043b\u0443\u043c\u0431\u0430\u0439\u043d\u00bb<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2006_%D0%B3%D0%BE%D0%B4\" title=\"2006 \u0433\u043e\u0434\">2006<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%BE%D1%80%D1%81%D0%B8,_%D0%94%D0%B6%D0%B5%D0%BA\" title=\"\u0414\u043e\u0440\u0441\u0438, \u0414\u0436\u0435\u043a\">\u0414\u0436\u0435\u043a \u0414\u043e\u0440\u0441\u0438<\/a> \u043e\u0442\u043f\u0440\u0430\u0432\u0438\u043b \u043f\u0435\u0440\u0432\u043e\u0435 \u0441\u043e\u043e\u0431\u0449\u0435\u043d\u0438\u0435 \u0432 \u0441\u043e\u0437\u0434\